DIGITS = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/"

def base64_to_base10(string):
    return sum(DIGITS.index(digit) * 64**i
               for i, digit in enumerate(string[::-1]))

def base64_to_base10(str):
    res = 0
    for c in str:
        res *= 64
        res += "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/".find(c)
    return res

abc = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'

def base64_to_base10(str, order=1):
  return base64_to_base10(str[:-1], order*64) + abc.index(str[-1]) * order if str else 0

